import React from 'react';
import { Link } from 'react-router-dom';
import './index.css'; // Add a separate CSS file for styling

const Navbar = () => {
  return (
    <div className="navbar-container">
      <nav className="navbar">
        <div className="navbar-logo">
          <Link to="/" className="navbar-brand">
            Fitness Tracker
          </Link>
        </div>
        <ul className="navbar-links">
          <li><Link to="/dashboard">Dashboard</Link></li>
          <li><Link to="/cardio">Cardio</Link></li>
          <li><Link to="/resistance">Resistance</Link></li>
          <li><Link to="/profile">Profile</Link></li>
        </ul>
        <div className="navbar-auth">
          <Link to="/login" className="auth-button">Login</Link>
          <Link to="/signup" className="auth-button">Signup</Link>
        </div>
      </nav>
      <footer className="navbar-footer">
        <p>&copy; {new Date().getFullYear()} Noor ul Ain. All Rights Reserved.</p>
      </footer>
    </div>
  );
};

export default Navbar;
